import React, { Component } from "react";
import { data } from "./data";
import ProductList from "./ProductList";
import "./App.css";
export default class App extends Component {
  state = {
    products: data,
  };
  render() {
    return (
      <div>
        <ProductList products={this.state.products} />
      </div>
    );
  }
}
